    		v /= Math.pow(2, e-31);
    		v2 = (v)>>>0;
    		if((v2&0x80000000) == 0) { v/=2; ++e; v2 = v >>> 0; }
    		v -= v2;
    		v2 |= 0x80000000;
    		v2 >>>= 0;
