    	o.write_shift(-4, 0);
    	o.write_shift(-4, 460);
    	o.write_shift(4,  28800);
    	o.write_shift(4,  17600);
    	o.write_shift(4,  500);
    	o.write_shift(4,  idx);
    	o.write_shift(4,  idx);
    	var flags = 0x78;
    	o.write_shift(1,  flags);
    	return o.length > o.l ? o.slice(0, o.l) : o;
